(()=>{const isRange=condition=>condition&&typeof condition==="object"&&("min"in condition||"max"in condition);const filterObjs=(objects,filters,callback=null)=>{const length=filters.length;const ext=filters.ext;delete filters.ext;delete filters.length;const result=[];let count=0;for(const obj of objects){if(length&&count>=length){break}const isMatch=Object.entries(filters).every((([key,condition])=>{const val=obj[key];if(isRange(condition)){const{min:min,max:max}=condition;return(min==null||val>=min)&&(max==null||val<=max)}if(Array.isArray(condition)){return val.includesAll(condition)}return val===condition}));if(isMatch&&(callback==null||ext==null||callback(obj,ext))){result.push(obj);count++}}return result};setup.filterObjs=filterObjs;window.filterObjs=window.filterObjs||filterObjs})();
